webpackJsonp([0x78aa11966493],{1391:function(a,e){a.exports={data:{markdownRemark:{html:"<p>本会議を開き、教育システムの意思決定レベルを含む安定性に関する最近の懸念について話し合った。例えば、本土からの生徒の中には、困難な生活をしている人がいれば、西部地域の経済発展と沿岸部の経済発展の違いが原因であると言われています。これは問題です。今や、このような性質を持たない問題が常に発生し、社会的、政治的な意味があるような分析もあります。そのような学習は、特定の条件下で不必要な社会問題を引き起こす可能性があります。</p>\n<p>「学習する」人は、しばしば簡単な問題を複雑にし、複雑な問題を単純化する本能を持ち、これが「学習」であると考えます。あるケースでは、これは真実であり、別の条件では、これは真実ではありません。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0042.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0042.md",frontmatter:{title:"2月25日 金曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0042.md absPath of file >>> MarkdownRemark"}}}});
